import{_ as r,c as t,a5 as o,o as i}from"./chunks/framework.BgPEmfgH.js";const h=JSON.parse('{"title":"Resources Used, Honorable Mentions","description":"","frontmatter":{},"headers":[],"relativePath":"miscellaneous/resources-used-honorable-mentions.md","filePath":"miscellaneous/resources-used-honorable-mentions.md","lastUpdated":null}'),s={name:"miscellaneous/resources-used-honorable-mentions.md"};function a(n,e,l,p,d,g){return i(),t("div",null,e[0]||(e[0]=[o('<h1 id="resources-used-honorable-mentions" tabindex="-1"><strong>Resources Used, Honorable Mentions</strong> <a class="header-anchor" href="#resources-used-honorable-mentions" aria-label="Permalink to &quot;**Resources Used, Honorable Mentions**&quot;">​</a></h1><p>As it is an attempt to compile over 5 years of Profit-Taker knowledge, this guide has been a collaborative effort from the Profit-Taker community. Here we acknowledge people outside the main team who helped contribute images, videos, time, and more to this project, along with paying homage to our predecessors.</p><h2 id="notable-contributors" tabindex="-1"><strong>Notable contributors:</strong> <a class="header-anchor" href="#notable-contributors" aria-label="Permalink to &quot;**Notable contributors:**&quot;">​</a></h2><p><strong>Vaeli</strong></p><ul><li>contributed post-Dante Pogris strats</li></ul><p><strong>Reuzehagel</strong></p><ul><li>Did Proofreading, helped with setting up the website, scripting, rewriting.</li></ul><p><strong>ZeyroX</strong></p><ul><li>Set up all the baseline stuff for the website: hosting, frameworking etc. and helped with developing it along the way</li></ul><p><strong>UnOriginalGN</strong></p><ul><li>Did proofreading and some of the math.</li></ul><p><strong>Fremy</strong></p><ul><li>Provided coverage of Chroma speedruns and how to utilize Virtuos Surge for Operator Element.</li><li>provided footage for archgun hitbox bug</li></ul><p><strong>Okayeg</strong></p><ul><li>Provided previously compiled builds in the form of overframe links.</li><li>Assisted with the creation of the basic builds section.</li><li>Did final spell-checking and grammar passes.</li></ul><p><strong>Touc</strong></p><ul><li>Bug testing and research.</li><li>Provided Contagion macro.</li><li>Provided zaw spreadsheet.</li></ul><p><strong>Neko.</strong></p><ul><li>Provided footage of hard landings.</li><li>Provided images of their speedrun build. These were replaced in the Jan 2023 update.</li></ul><p><strong>Bane</strong></p><ul><li>Provided a video of Opticor pylons.</li></ul><p><strong>Tater.</strong></p><ul><li>Provided knowledge on Ass Meta.</li><li>Provided several gifs, the one used for Ass Meta is his.</li></ul><p><strong>Ceesay</strong></p><ul><li>Provided Catabolyst and Gammacor builds.</li></ul><p><strong>44bananas</strong></p><ul><li>Discovered that Vengeful Archwing applies to Pogris.</li></ul><p><strong>ErwinsArm</strong></p><ul><li>Provided a video of Armor Reset.</li></ul><h2 id="great-guides-of-the-past" tabindex="-1"><strong>Great guides of the past:</strong> <a class="header-anchor" href="#great-guides-of-the-past" aria-label="Permalink to &quot;**Great guides of the past:**&quot;">​</a></h2><p>Profit-Taker guides have had a bit of a rocky history.  Many innovations have remained in relatively small communities for extended periods of time before becoming known to the greater public, and much Profit-Taker knowledge is communicated entirely via word-of-mouth. Here are some stand-out guides that have helped to spread Profit-Taker knowledge over the years. It is not a comprehensive list, merely the most notable.</p><p><strong>This guide, version 3!:</strong></p><p><a href="https://docs.google.com/document/d/1DWY-ZNv7cUA6egxDZKYu0e8qz7z-yHT2KncyYAo5NHU/edit" target="_blank" rel="noreferrer">5 (and a bit) Years of Profit-Taker</a></p><p>This is the guide as it was the day the Website dropped.</p><p><strong>This guide, version 2!:</strong></p><p><a href="https://docs.google.com/document/d/1ScNTjFNj3btq06BtqAkTn1m9tN9UqXNaYO_AqiCGgi4/edit?usp=sharing" target="_blank" rel="noreferrer"><strong>3 (and a half) Years of Profit-Taker Archive 2</strong></a></p><p>This is the guide as it was the day the March 2024 update dropped.</p><p><strong>This guide, version 1!:</strong></p><p><a href="https://docs.google.com/document/d/1hd0bA5H1dsWdYjymb1Lqu3-hWrxTFMxLAtd2V6pgsq0/edit?usp=sharing" target="_blank" rel="noreferrer"><strong>3 (and a half) Years of Profit-Taker Archive</strong></a></p><p>This is the guide as it was the day the Jan 2023 update dropped.</p><p><strong>Vaeli&#39;s Dante Pogris Guide</strong></p><p><a href="https://tinyurl.com/DantePogris" target="_blank" rel="noreferrer">https://tinyurl.com/DantePogris</a></p><p>now integrated into <a href="/advanced/speedrun-strats.html#fast-pogris-pylons-double-shot-void-strike">Speedrun Strats</a></p><p><strong>Neemiii’s Profit-Taker loadout and Riven guides (posted on the Warframe Community Discord):</strong></p><p>Chroma:</p><p><a href="https://tinyurl.com/NeemiiiPTChroma" target="_blank" rel="noreferrer"><strong>https://tinyurl.com/NeemiiiPTChroma</strong></a></p><p>Saryn:</p><p><a href="https://tinyurl.com/NeemiiiPTSaryn" target="_blank" rel="noreferrer"><strong>https://tinyurl.com/NeemiiiPTSaryn</strong></a></p><p>Volt:</p><p><a href="https://tinyurl.com/NeemiiiPTVolt" target="_blank" rel="noreferrer"><strong>https://tinyurl.com/NeemiiiPTVolt</strong></a></p><p>Riven Guide:</p><p><a href="https://tinyurl.com/NeemiiiPTRiven" target="_blank" rel="noreferrer"><strong>https://tinyurl.com/NeemiiiPTRiven</strong></a></p><p>His Riven guide was used as a base for this guide’s Riven guide.</p><p><strong>Kalaay’s Profit-Taker guide:</strong></p><p><a href="https://youtu.be/lwpmGCcgrE0" target="_blank" rel="noreferrer">youtu.be/lwpmGCcgrE0</a></p><p><strong>Mebius’ guide (Chinese):</strong><br><a href="https://www.bilibili.com/video/BV1nL4y1M7nz" target="_blank" rel="noreferrer"><strong>【Warframe】电男大蜘蛛竞速攻略全方位详解（2022最新版）</strong></a><br> This guide popularized and brought up-to-date Profit-Taker speedruns to the Chinese community. Is taken offline now.</p><p><strong>Axel’s Profit-Taker guide:</strong></p><p><a href="https://youtu.be/gegyu6zEWxo" target="_blank" rel="noreferrer">youtu.be/gegyu6zEWxo</a></p><p><strong>RoboSt3alth’s Profit-Taker guide:</strong></p><p><a href="https://youtu.be/oWvet2JCypU" target="_blank" rel="noreferrer">youtu.be/oWvet2JCypU</a></p><p>These two guides were at the time, and for a long time afterward, the most accurate and up-to-date Profit-Taker guides on youtube. As of the publishing of the first version of this guide, they were still the best.</p><p><strong>Blunt’s Profit-Taker guide:</strong></p><p><a href="https://www.speedrun.com/wf/guide/dhzpo" target="_blank" rel="noreferrer"><strong>Profit-Taker Guide - Warframe</strong></a></p><p>Written during the Saryn meta, this guide covers many important nuances of said meta. Blunt took the Saryn meta to its extreme through thousands of runs, reaching an impressive time of 1m 18s. Blunt referred to:</p><p><a href="https://www.reddit.com/r/Warframe/comments/isqhzp/comment/g59mkqj/?utm_source=share&amp;utm_medium=web2x&amp;context=3" target="_blank" rel="noreferrer"><strong><strong>Iterniam’s Comment on the first sub 100s Profit-Taker run</strong></strong></a></p><p><strong>Which was a follow-up to Iterniam’s <em>Six Principles of Profit-Taker:</em></strong></p><p><a href="https://www.reddit.com/r/Warframe/comments/hft48g/the_six_principles_of_profittaker_a_speedrunners/" target="_blank" rel="noreferrer">**<strong>The six principles of Profit-Taker - A speedrunner&#39;s guide. : r/Warframe</strong> **</a></p><p>Which have been integrated into this guide as the <a href="/beginner/basic-principles.html"><strong>build basics</strong></a> section. This was the first good Profit-Taker guide, but it really shows its age.</p>',68)]))}const m=r(s,[["render",a]]);export{h as __pageData,m as default};
